import React from 'react';
import UserLoginApp from './userLogin/userLoginApp'
import './common/css/App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom';

function App() : any {
  return (
    <Router>
      <div className="background">
        <UserLoginApp />
      </div>
    </Router>
  );
}

export default App;
